tables.table_schema:
CREATE TABLE VoiceInteractions (
    interaction_id INT PRIMARY KEY,
    user_id INT,
    timestamp TIMESTAMP,
    duration INT
);

CREATE TABLE Users (
    user_id INT PRIMARY KEY,
    name VARCHAR(50),
    email VARCHAR(100)
);

CREATE TABLE Sessions (
    session_id INT PRIMARY KEY,
    user_id INT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE Analytics (
    analytics_id INT PRIMARY KEY,
    session_id INT,
    interaction_id INT,
    analysis_result TEXT
);
